(54, 'jingboranzixun', '\r\n\r\n  \r\n  井柏然资讯直通车微信正式开通啦，扫描二维码或者添加微信号，就可以及时了解到井柏然的最新消息咯~期待你的加入~~ ', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_2013011503381116COP.jpg'),
(55, 'Willpanweipo', 'Willpanweipo 潘玮柏（Wilber Pan）美籍华人， 台湾流行歌手 2011年主演《爱∞无限》当选台湾46届金钟奖最佳男主角。潘玮柏刚出道时除身为ChannelV音乐台VJ外，常在台北接拍平面及电视广告，2002年向歌坛发展，缔造出《高手》《零零七》等八张畅销专辑，成为歌影视界的实力偶像全能艺人，在大陆人气鼎旺。2009年更升级潮店老板，所开设的NPC潮流服饰店在上海、北京均有店铺。2011年跨界软件行业，担任卡米果公司游戏创意总监设计了下载量第一的“熊猫屁王”游戏，成为中国演艺界第一个成功跨足软件业的艺人。其唱片全亚洲总销量已突破600万张。  			  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060615551B4G4.jpg'),
(56, 'zhangxinyixinyi', '\r\n张歆艺（1981年5月29日—），中国内地女演员。出生于四川成都。1998年毕业于四川艺术职业学院，1998至2001年为深圳市歌舞团演员，2001年至2005年为中央戏剧学院表演系本科班学生。2012年，凭借热播剧《北京爱情故事》中爽朗率性的“夏姑娘”林夏一角而人气高涨。同年，主演杨树鹏指导的电影《匹夫》，受到更多的关注。在2012年“80后新生代娱乐大明星”评选活动中，张歆艺被评选为内地新“四小花旦”（与杨幂、刘诗诗及白百何）之一。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060555531812q.jpg'),
(57, 'jcfangzi', '房祖名，原名陈祖名。中国香港知名演员、歌手。父亲是巨星成龙，母亲是港姐林凤娇，人称“龙子”。 自出道以来，他已出演了《千机变2》《追影》《早熟》《花木兰》等影片，他还出过自己的唱片《边走边唱》。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060554021d7oq.jpg'),
(58, 'fengshaofeng1007', 'fengshaofeng1007 冯绍峰，本名冯威，出生于上海，中国内地男演员，2001年毕业于上海戏剧学院97级表演系本科。前期多饰演风度翩翩的贵族公子，《锁清秋》中的沈朝宗、《佳期如梦》中的孟和平等，获得「年代戏第一小生」的称号。2011年凭借清穿剧《宫锁心玉》中的八阿哥一角一炮而红，同年出演李仁港导演的电影《鸿门宴传奇》中项羽一角，成功塑造了霸气与柔情兼具的西楚霸王。之后相继参与了多部电影演出，获得媒体和观众的一致肯定。2012年担任电视剧《兰陵王》的监制和主演。  			  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060552071qQoc.jpg'),
(59, 'liyugang1311', '李玉刚微信号：liyugang1311 \r\n', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060549461gbjO.jpg'),
(60, 'Rainieyang060477', '杨丞琳（Rainie Yang，1984年6月4日—）中国台湾人，祖籍广东省，毕业于华冈艺校，华语女歌手、演员、主持人，是一位多栖发展的女明星，唱片销量超过1005万张，有“亚洲全能天后”之称。2000年加入4 in love组合出道，2002年末主持综艺节目《我猜我猜我猜猜猜》长达4年。2005年凭借专辑《暧昧》和偶像剧《恶魔在身边》而走红。2010年凭借主演的偶像剧《海派甜心》夺得第45届电视金钟奖最佳女演员，封获“金钟影后”称号。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_2013010605472712uft.jpeg'),
(61, 'caoyunjin', '微信号：caoyunjin 曹云金，相声演员，2001年经田立禾先生开蒙，2002年拜师郭德纲先生学习相声艺术。经常表演的节目有《拴娃娃》、《大保镖》、《托妻献子》、《学四省》等，被称为“德云四少”之一。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_20130106054504161u6.jpg'),
(62, 'le-jia', '乐嘉微信号： le-jia \r\n 乐嘉，中国性格色彩研究中心创办人，FPA(Four-colors Personality Analysis) 性格色彩创始人，培训师，电视节目主持人。备受各阶层广泛推崇的卓越的演讲者和培训导师，著有畅销书《FPA性格色彩入门——跟乐嘉色眼识人》、《色眼再识人》、《让你的爱非诚勿扰》、《人之初，性本色》《跟乐嘉学性格色彩》和《微勃症》。同时出版了培训教学DVD《性格色彩乐嘉说》。于2010年担任江苏卫视《非诚勿扰》嘉宾主持，11年江苏卫视《不见不散》主持人。   			  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060543261qFw3.jpg'),
(63, 'BY2          by2youyou01', 'BY2微信号：by2youyou01 ', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_2013010605415815999.jpg'),
(64, 'liksunfong', 'liksunfong 方力申（Alex Fong，1980年2月26日—），香港歌手、演员，前香港游泳代表，曾代表香港参与2000年悉尼奥运游泳项目，后来签约百代唱片加入娱乐圈。电视剧代表作有电视广播有限公司的《甜孙爷爷》。歌曲有《就是这么爱你》、《ABC君》、《在你遥远的附近》等，与绯闻女友邓丽欣合唱多首歌曲例如《好心好报》、《好好恋爱》、《十分．爱》。电影方面，他主演的爱情片《十分爱》与《我的最爱》票房均高达1200万。  			  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060540311H8mQ.jpg'),
(65, 'kenjiwu01', '吴克羣 微信号：kenjiwu01 \r\n吴克羣， 流行歌手，著名音乐人，作曲家，词人，兼具偶像与实力的创作歌手，华语乐坛颇具影响力的唱作天王。同时拥有演员、主持人、模特等多重身份，在戏剧、主持、电影、广告等领域都取得不俗成绩。2000年发行首张专辑并正式出道。 2010年9月15日宣布将艺名“吴克群”正式改回本名“吴克羣”， 出道至今，共发行7张唱片，其中6张全创作专辑。其唱片全亚洲总销量已突破600万张。 ', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_2013010605355414gF8.jpg'),
(66, 'mengfeiweixin', '孟非微信号：mengfeiweixin \r\n\r\n', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060533171Xac7.jpg'),
(67, 'chilinglin', '林志玲，出生于中国台湾省台北市，毕业于多伦多大学，是台湾的一位超级名模，是港台两地的大明星。2003年，林志玲取代萧蔷当选“台湾第一美女”，接拍了无数名牌广告。2007年，林志玲和吴宇森合作拍摄大片《赤壁》，饰演周瑜的妻子小乔，之后出演了《幸福额度》《刺陵》《&nbsp;决战刹马镇》等多部影视剧。2011年，林志玲收入近2亿新台币，使其连续八年蝉联台湾最富女模。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_20130106053048178C7.jpg'),
(68, 'wangfengmusic', '\r\n\r\n汪峰，内地著名音乐人，中国新摇滚乐的代表人物之一。鲍家街43号乐队发起人，自幼接受专业音乐教育。汪峰本人具有较强的歌曲创造能力，被称为“音乐才子”。曾多次荣获国内各大音乐颁奖典礼的最佳男歌手、最佳制作人大奖。其音乐风格独特，歌曲较为关注人的理想与现实世界的困惑。《飞得更高》《怒放的生命》《春天里》《再见青春》等作品广为传唱。火爆2012夏天的《中国好声音》选秀节目，汪峰不但助阵那英的小二班比赛，其多首歌曲如《北京北京》由好声音年度总冠军梁博在巅峰时刻演唱，再次将汪峰及其作品推向新的高度。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060529091WoPq.jpg'),
(69, 'dazuozone', '\r\n大左，原名左大建，中国大陆著名节目主持人，光线传媒首推男主持，“光线三宝”之一（另外两人是谢楠、柳岩）。主持娱乐现场、和蒙牛酸酸乳音乐风云榜等节目。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060526251Czvn.jpg'),
(70, 'showlo_no1', '\r\n\r\n罗志祥（Show Lo），亚洲超人气偶像天王，有着亚洲舞王之称。是一名集歌手、舞者、演员、主持人等多方位发展的的全能艺人。近年自创品牌“STAGE”，成功进军潮流界，先后在台湾、香港、新加坡开设分店。所有唱片全亚洲销量超过700万张，并获得2010年和2011年台湾销售总冠军。唱片公司金牌大风及经纪公司百娱国际文化传媒有限公司称罗志祥2012年第9张最新专辑《有我在》于2012年4月6日正式发行。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_2013010605193410rJA.jpg'),
(71, 'qw735439846', '\r\n&nbsp;戚薇，中国大陆人气女歌手、演员。毕业于浙江传媒学院录音艺术专业。2006年参加上海东方卫视的《我型我秀》选秀节目出道，凭借一首《外滩十八号》红遍全国。发表个人单曲《太过爱你》《如果爱忘了》《黑白之间》《没收》《放开爱》等，也是内地为数不多的极具表演天赋的女歌手，主演电视作品《美人心计》《无懈可击之美女如云》《夏家三千金》《无懈可击之高手如林》《爱情睡醒了》等。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_2013010605055813Q3T.jpg'),
(72, 'wangjieloveyou', 'wangjieloveyou 王杰，1962年10月20日生，华语流行乐坛的超级巨星，出道至今已发行50余张个人专辑和30张精选辑，唱片累计销量至今已过8千万张。1987年发行专辑《一场游戏一场梦》，至今销量1800万张。代表作有歌曲《英雄泪》、《她的背影》、《永远相信爱情》、《我爱你》、《谁明浪子心》、《回家》、《红尘有你》、《梦在无梦的夜里》、《最后的温柔》、《向太阳怒吼》；专辑《是否我真的一无所有》、《忘了你忘了我》、《为了爱梦一生》。也出演过电影《七匹狼之青春引爆》、《至尊无上2之永霸天下》等。广州、深圳演唱会票房告捷。  			  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060500201r9Cf.jpg'),
(73, 'tangyan_wxvip', '\r\n唐嫣，中国女演员。1986年12月6日出生于上海，祖籍宁波。2004年被张艺谋亲定为奥运宝贝，代表中国站在世界的舞台上。2006年毕业于中央戏剧学院表演系本科班。2007年凭借电影处女作《离别也是爱》获第十三届上海电视节电视电影最佳女演员提名。2009年出演电视剧《仙剑奇侠传三》中坚强执着的紫萱和电影《风云2》中单纯善良的楚楚使她脱颖而出。2011年因在热播剧《夏家三千金》中饰演女主角夏天美一角而人气高涨。2012年接连在《乱世佳人》《X女特工》《面包树上的女人》《格子间女人》等电视剧中担任女主角，并成立「唐嫣工作室」。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_20130106045658127up.jpg'),
(74, 'Jiro_fans', '\r\n人气偶像汪东城携全新专辑入驻，搜索添加为好友，一手快讯早知晓。扫描汪东城微信帐号二维码添加为好友参与互动', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060451431xjIQ.jpg'),
(75, 'wxhelaoshi', '何炅 微信号：wxhelaoshi 何炅，中国知名主持人，北京外国语大学阿拉伯语系教师。自1998年起，主持湖南卫视的《快乐大本营》栏目长达十余年。此外，曾主演《正德演义》等影视剧，并发行过3张音乐专辑和4部文学作品 ', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2012/12/1_20121224044835188J7.jpg'),
(76, 'foreverlove_mayday', '五月天（Mayday）是台湾的乐团，由乐队团长兼吉他手怪兽、主唱阿信、吉他手石头、贝斯玛莎和鼓手冠佑组成，前身为“So Band”乐团，在1997年3月29日改名为“ 五月天”。 ', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2012/12/1_201212240447031wtXT.jpg'),
(77, 'libingbinglove', '李冰冰官方微信帐号', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2012/12/1_201212102310281hWw6.jpg'),
