(82, 'wushowzongxian', '', '2013-09-22 08:43:26', 'http://www.starbot.org/attachments/2012/11/1_201211291253261hS2H.jpg'),
(83, 'hawicklaw', '\r\n刘恺威，香港影视歌多栖男艺人。1993年获加拿大华人歌手选拔赛冠军，1994年踏足演艺圈。在TVB做过歌手，跑过龙套，当过主角，2005年离开TVB，2007年正式投身内地。2008年凭《凤穿牡丹》中的霍冬青在内地崭露头角。2011年因《千山暮雪》中饰演的莫绍谦进一步走红，人气暴增，被观众封为“言情小说男主角最佳代言人”。2012年刘恺威首次制片并主演《盛夏晚晴天》。其他代表作有《国色天香》、《美人无泪》、《画皮Ⅱ》电视剧、《江南四大才子》等。12年12月28日，刘恺威正式宣布刘恺威工作室成立，13年3月刘恺威工作室将开拍《一念向北》。&nbsp;  			  			  			  			  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060613121k3hC.jpg'),
(84, 'huge_weixin', '\r\n&nbsp;胡歌（1982年9月20日－），中国上海人，知名男演员、歌手，有“古装王子”的美称。14岁便成为电视台的主持人，2005年毕业于上海戏剧学院01级表演系本科，随后签约上海唐人电影制作有限公司，凭借电视剧《仙剑奇侠传》男主角李逍遥而成名。2006年拍摄《射雕英雄传》期间遭遇车祸停滞一年，随后又出演了《仙剑奇侠传三》《神话》等热播剧，打破电视台收视记录。2012年担任电视剧《轩辕剑之天之痕》的出品人和主演。曾发行个人专辑《出发》及出版书籍《幸福的拾荒者》。其人擅长摄影，文采飞扬，志做导演，频唱影视剧歌曲  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060618241jBLx.jpg'),
(85, 'jingleixu', '&nbsp;徐静蕾，中国著名女演员、导演，与章子怡、周迅、赵薇并称中国演艺界四大花旦。代表作品有《一场风花雪月的事》《将爱情进行到底》《一个陌生女人的来信》《杜拉拉升职记》等。因其自导自演电影票房口碑双丰收及博客点击率在中国大陆地区长期排名第一，故有大陆影视圈才女之称；书法手写体“清冽而又优雅”独具个性美感，被开发出字库“方正静蕾简体”。2007年开设网络电子杂志《开啦》。2011年4月27日，博客女王徐静蕾正式开通腾讯微博，于2011年6月30号突破千万级粉丝，成为史上最快拥有千万粉丝的腾讯微博。  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_2013010606212716531.jpg'),
(86, 'Chenkun_Chenkun', 'Chenkun_Chenkun 陈坤，内地著名男演员、歌手，中国影坛青年一代领军人物。1976年2月4日生于重庆，1999年主演电影《国歌》步入影坛，凭电影《云水谣》《画皮》荣获华表奖、百花奖双料影帝。近年以《龙门飞甲》《建国大业》《画皮》等电影中的突出表现赢得瞩目。曾任东方歌舞团歌唱演员，是内地首位登上央视春晚独唱、举行个人演唱会的男演员。演艺之外热心公益，被联合国儿童基金会任命为中国大使，持续捐助大爱清尘、关爱老兵、大病医保等民间慈善项目。发起公益项目“行走的力量”，个人随笔集《突然就走到了西藏》畅销30余万册，登上畅销作家榜。', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060623121Qss4.jpg'),
(87, 'ouhansheng', '', '2013-09-22 08:43:26', 'http://www.starbot.org/attachments/2012/11/1_201211291234211135D.jpg'),
(88, 'xuruyun_valen', '', '2013-09-22 08:43:26', 'http://www.starbot.org/attachments/2012/11/1_201211291231421mqiR.jpg'),
(89, 'karenmok01', '莫文蔚，香港著名影、视、歌多栖女星。英国伦敦大学高材生，掌握多门外语及乐器，在多部电影、电视剧中担纲主演，并且出有多张专辑并获得重量级音乐奖项。是华人娱乐圈中非常成功的女星之一，因此在整个华人地区拥有很高的知名度。2011年10月1日，莫文蔚与德国初恋男友Johannes在意大利完婚  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060625571uRzH.jpg'),
(90, 'angelababyyeung', '', '2013-09-22 08:43:26', 'http://www.starbot.org/attachments/2012/11/1_2012112912275216y8H.jpg'),
(91, 'account', '', '2013-09-22 08:43:26', 'http://www.starbot.org/attachments/2012/11/1_201211291226061qq88.jpg'),
(92, 'wlhmusicman', '\r\n王力宏（Leehom Wang，1976年5月17日—），美籍华人，祖籍浙江义乌。华语流行乐坛男歌手、音乐人，亚洲华语流行乐坛最具代表性的创作、偶像、实力派音乐天王。其唱片总销量在全亚洲已超过2500万张。从改编歌曲《龙的传人》中令人惊讶地融合DJ电子乐节奏的华人流行嘻哈摇滚风，到首次开创了chinked-out的新曲风，将华语音乐进一步推向全世界。除了在音乐方面的成就外，还参演了多部电影的拍摄，2010年首部自导自演的电影《恋爱通告》受到广大观众的好评。2011年9月推出全新作品《火力全开》，并以此为契机开展Music-man II全球巡回演唱会。&nbsp;  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060619471nM0U.jpg'),
(93, 'lovemingzone', 'lovemingzone \r\n黄晓明（1977年11月13日—），山东青岛人，中国著名男演员、歌手。2000年毕业于北京电影学院表演系本科班，现就读于北京大学EMBA。1998年开始拍电视剧，凭《大汉天子》成名，《神雕侠侣》和《新上海滩》跻身一线。2006年开始与名导合作商业片，奠定了其华语影坛新一代领军人物的地位，主演电影包括《风声》《叶问2》《唐伯虎点秋香2》《赵氏孤儿》《匹夫》《血滴子》《大上海》《中国先生》《白发魔女传之明月天国》等。除了片约不断，黄晓明也投资生意，积极参与慈善，并发行了两张个人专辑。  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_20130106055727175vb.jpg'),
(94, 'vae_xs', '', '2013-09-22 08:43:26', 'http://www.starbot.org/attachments/2012/11/1_201211291220371ooU1.jpg'),
(95, 'miniyangmi', '\r\n&nbsp;杨幂（1986年9月12日—），中国女演员、歌手。出生于北京。毕业于北京电影学院表演系2005级本科班。在2009年4月的“80后新生代娱乐大明星”评选活动中，杨幂成为内地新“四小花旦”（与黄圣依、王珞丹以及刘亦菲）之一。2006年因出演《神雕侠侣》中“小东邪”郭襄而受到观众的关注，2009年又凭借《仙剑奇侠传三》而人气飙升。2011年因为在穿越剧《宫》（又名《宫锁心玉》）中扮演洛晴川一角而获得了更高的人气。  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060624531DMLG.jpg'),
(96, 'wsl-silence', '\r\n  			  			  			  			\r\n', '2013-09-22 08:43:26', ''),
(97, 'mavis-fan', '\r\n范晓萱是一位集演唱、乐器演奏、词曲创作于一体的专业音乐人。年仅12岁（1989年）出道，以小魔女的形象红遍全亚洲。曾获得台湾金曲奖最佳单曲制作人和最佳专辑。2000年后不甘于只做儿童偶像，便从活泼可爱的风格转型为成熟中性的摇滚朋克风格，由于前后差异较大，使大多数的儿童、少年歌迷不能接受从而转型失败。近年以乐团和驻唱表演为主，近日颇受欢迎的作品有范晓萱与100%乐团合作的新专辑《赤子》，2010年获第十届华语音乐传媒大奖最佳国语女歌手。2011年正式宣布签约新艺宝唱片及百娱国际文化传媒有限公司，唱片约和经纪约双丰收。  			  			  			', '2013-09-22 08:43:26', 'http://www.anyv.net/attachments/2013/01/1_201301060628471C20c.jpg'),
