(241, 'arclub_com                     ', '\r\n建筑中国俱乐部（英文名：Architects Club of Archina）成立于2008年，是由建筑中国传媒有限公司旗下建筑中国门户和《建筑中国周刊》发起的针对于国内外设计师的会员联谊组织。依托上海市建筑学会、上海国际建筑文化传媒中心（ACMC）等机构，立足建筑、景观园林与室内设计行业，深化对设计师的全面服务。基于设计师俱乐部的服务条款，组合俱乐部多方资源，为设计师提供一个学习探讨、信息交流、自我展示的互动平台,让每一位会员拥有一个扬飞理想，启迪灵感，驾驭事业，满载自信的空间。建筑中国俱乐部已经得到行业内众多企业单位以及设计师的广泛支持和认同，官方网站为www.arclub.com，现拥有国内外实名注册建筑师13万名，已成为中国最大的实体设计师俱乐部。', '2013-09-22 08:50:31', 'http://www.anyv.net/datafile/2013/05/10443_201305301309321d8f8.jpg'),
