(248, 'carwatch                     +', '我们是来自大学生的新闻评论自媒体，我们坚持用独立的视角，每期用【一篇文字】【一张图片】【一篇小说】带给你另类的阅读体验，图片片片精彩，文字篇篇犀利，小说部部新奇，每月15期，送到您的手上，让您感受到大学生的活力。这就是我们，【赛车手图文观天下】\r\n\r\n推送内容示范：\r\n\r\n  【一张图片】  吃西瓜时，一刀分为两半，用一柄小勺切着吃，大概是人世间最幸福的事了。但是，来自创意的快乐，和不懈的努力，让西瓜变得智能了，你看，这个装瓜籽的小碗，真让人觉得无比震惊。  \r\n  【一篇文字】  \r\n  烟涛微茫信难求  \r\n  一直以来，我一直在猜测“微信”这个名字的来历。但是，如今这个名字却也成为了多方争执的焦点，而这个争执就是为了“收费”。  \r\n  每年在春节期间都会在《新闻联播》里出现有关中国三大电信运营商的消息，通常是这样一则消息：“今年春节期间，全国短信发送量达到多少亿条，比去年同比上升多少，平均每几个中国人就会发送多少条短信。”  \r\n  但是这个曾让三大电信运营商自豪的消息，如今有可能再也不会出现了，那些作为电信运营的基础功能，如通话和短信，都在微信的冲击下，岌岌可危。由于微信可以发送短暂的语音和不限量的文字信息，甚至是传送视频图片，这种即时通讯的OTT业务，直接对运营商的传统业务形成了压力。并且，由于依托独立的App平台，微信客户端可以保存用户的所有内容，这种自称生态的产品，显然在冲击着运营商的神经。  \r\n  不论是媒体还是腾讯，在这次争端里，都倾向于支持微信不收费，而三大运营商则被塑造为“垄断者的扼杀心在作祟”的丑陋形象。但是，中移动的苦水也很直接，苦心经营的数据通讯网络，如今却需要为人嫁衣裳，而移动自身的3G通讯又无法与联通电信的成熟网络对比，依赖于2G网络的数据业务，在微信的短时数据占用下，很有可能受到损害。而免费的微信，为此占用通道，却不必为网络的建设和维护付出任何费用，这种在运营商看来“吃白食”的做法，自然需要去打击。  \r\n  值得玩味的是，本该同一战壕的联通和电信，却没有想象中的那么激动。因为这两家的运营商在数据流量业务上一直做了大量努力和工作。与中移动不同，他们本身对语音通话和短消息业务的依赖并不如移动那么大，电信甚至表示会对其数据业务做更大的发展升级。  \r\n  于是，微信收费的口号除了在坊间与社会产生争议，也在业内变成了争论的热点。毕竟3亿的用户群，一旦开动收费的闸门，很难保证有各方都满意的方案。我们也注意到，三大运营商都有其各自的OTT业务，但是却都不尽人意，这不得不让人赞叹微信的生命力。  \r\n  微信到底该不该收费，其实没必要在百姓中争论。作为一种替代性的产品，微信像过去的手机一样，替代了传呼机，而传呼机又替代了电报和固定电话。每种新技术的产生，一旦代替了某些旧技术，那么争端自然会产生，而这时就不应该用百姓的利益换取新旧交替的损失。  \r\n  想想胶卷被数码相机淘汰的时候，我们受到的冲击，其实更多的是怀旧与失落，但是我们也得到了数码相机的便利。如果微信收费了，那么我们应该看到的是，新技术能够不断满足日益膨胀的需求，微信应该可以更炫更有用处，老技术慢慢得到退化或者保持它的不可替代性。  \r\n  还是题目的那句诗：“海客谈瀛洲，烟涛微茫信难求”。不管收费与否，我们等待着。', '2013-09-22 08:50:31', 'http://www.anyv.net/datafile/2013/05/10002_201305261932021nh6t.jpg'),
