(274, 'lookxhj                     ', '最近微信小黄鸡（微信号：lookxhj）异常的火爆，在大、中学生以及广大青少年和白领中受到热烈追捧，笔者也是微信小黄鸡的忠实粉丝，发现这只智能的卖萌鸡的确为生活增添了各种各样的乐趣。据统计，现如今全球已有270万用户在使用小黄鸡机器人。小黄鸡提供了英文、中文、韩文等44种语言，拥有庞大的数据库，英文内容有400万条数据，中文有16万左右。\r\n通过以上数据我们可以看到，小黄鸡的中文词条与英文词条相比差了25倍之多，这也就是为什么小黄鸡在中文聊天上不够出色的原因。小黄鸡的工作原理是回复用户通过tech功能教会他的词汇，并不会自学。所以小黄鸡的智商也在用户手中，这就好比自己的孩子，他会说多少话完全取决于学习，那么最快的学习方法便是通过父母的教导。 另外，小黄鸡的命运也掌握在大家手中，你的小黄鸡可以成为一个温柔贤惠的小黄鸡，同样也会成为一个很黄很暴力的小黄鸡。想让你的小黄鸡成为什么样的人，要好好拿捏一下哦！那么怎么添加官方微信小黄鸡呢？下面我为大家详细讲解 ', '2013-09-22 08:50:31', 'http://www.anyv.net/attachments/2013/05/8470_201305120109101L9q2.jpg'),
