(298, 'newsgd', '    广东电视台  \r\n  广东电视台成立于1959年，是新中国成立最早、规模最大的省级电视台之一。  \r\n  目前，广东电视台已拥有一支高素质的专业人员队伍，节目制作能力强，技术设备先进，已与世界50多个国家和地区的200多家电视台和影视机构建立业务合作关系。在中国电视传媒市场中，广东电视台依托广东雄厚的经济发展优势，勇于改革创新，始终保持着强势的竞争的实力。  \r\n  凭借广东的地缘、人文、经济优势和前瞻的意识，广东电视台近年来不断拓展自己的传播平台和开拓新产业，先后开办了广东卫视、珠江频道、体育频道、公共频道、新闻频道、嘉佳卡通频道、国际频道等7个开路电视频道和8个数字付费频道。  \r\n  卫星频道  \r\n  广东卫视使用普通话播出，通过“中星5A/6A”两颗卫星同时传输，24小时全天播放，全球覆盖人口20亿以上，在澳大利亚、新西兰、新加坡、马来西亚、印度尼西亚、泰国、菲律宾、斯里兰卡等国家，广东卫视已成为当地华侨观众的首选。目前，广东卫视在国内可接收人口达7亿，连续10年位居全国卫视覆盖排行榜前列。广东卫视是中国电视版图上最具创新意识、最具活力的省级卫视之一，是广东最具影响力的省级电视频道。近年来，广东卫视立足“活力中国”这一定位，节目推陈出新，频道整体气质青春阳光、新锐时尚，深受广大观众喜爱。2007年，广东卫视荣获“全国十大最具广告投放价值的电视频道”、“中国十大最具投资价值创意新媒体”称号。2010年,广东卫视荣获“2009-2010中国广电创新年度品牌”、“2001-2010年中国广电（省级卫视）领军品牌”荣誉称号。2011年，广东卫视荣获“2011中国十大卫视”荣誉称号。  \r\n  珠江频道  \r\n  广东电视台珠江频道开播于1983年9月，为广东电视台第二套节目，时称“十四频道”，1988年2月改呼号为“广东电视珠江台”，后又以“广东电视台珠江频道”的呼号沿袭至今。  \r\n  珠江频道是我国境内第一个用粤语方言播出的电视频道,也是广东省内覆盖第一、收视第一、创收第一、影响第一的地面频道。近年来，珠江频道先后获得“TV地标?全国省级地面频道综合实力十强”（第一名）、中宣部、广电总局等六部委颁发的“全国新闻工作先进集体”、“2008－2009年度中国地面频道经营管理十强”等荣誉，2008年、2009年、2010年连续获得“中国最具网络影响力的十大地面频道”称号。  \r\n  体育频道  \r\n  广东电视台体育频道作为华南地区最专业的体育频道，在广东全省拥有1100万用户，节目制作人员超过200人。并且负责过北京奥运会、广州亚运会和深圳大运会等国内外大型综合性运动盛会的宣传报道和公用信号制作。  \r\n  &nbsp;  \r\n  &nbsp; &nbsp; 目前，广东体育频道一直在“良性循环”的轨道上发展，《体育世界》、《晚间体育新闻》、《足球周刊》、《狂野角斗士》等品牌栏目不断创新，每年直播赛事超过1500场。在广东地区超越中央五套，成为观众收看体育节目的首选频道。  \r\n  公共频道  \r\n  广东电视台公共频道是覆盖县乡的省级主力频道，是广东地区一个充满活力、影响力不断提升的新锐电视频道。2011年4月，公共频道启用“苹果纪”的频道概念，以苹果其具有平安、美满的吉祥寓意，向大众宣扬关注民生生活，为创造幸福生活而努力的美好意愿。公共频道竭力为电视观众提供丰富的娱乐资讯和民生讯息，其收视率和频道影响力在广东地区得到了很好地提升和发展。  \r\n  新闻频道  \r\n  广东新闻频道立足广东，面向全国，紧盯世界，将着力打造为最具影响力的区域电视频道。广东新闻频道是广东地区唯一的省级新闻专业频道，于2005年12月8日正式开播。是观众及时了解资讯的首选平台，浏览时政、经济、文化、民生信息及深度解读的第一窗口。 在“第四届中国品牌媒体高峰论坛”上，新闻频道荣获2011年度“中国品牌媒体百强——最具品牌价值地面频道10强”的荣誉称号，2010年、2011年连续两年获得“金长城传媒奖——中国十大广播电视频道”的称号。  \r\n  嘉佳卡通频道  \r\n  广东电视台嘉佳卡通卫视于2007年3月正式开播以来，一直紧紧围绕“健康、快乐”的理念，构建“媒介组合动画传播平台”。嘉佳卡通卫视现已完整覆盖广东、广西、贵州、海南、河南、湖北、浙江、福建、安徽、四川、吉林16个省市地区以及IPTV覆盖的上海、江苏等地区，覆盖范围达5500万户，达到国内有线电视用户总比的29.1%，收视人口超过6亿。2010年3月通过资源整合，嘉佳卡通卫视率先成为国内拥有全产业链资源的专业媒体，实现了集内容原创、媒体播出、产品研发、市场销售等紧密合作的产业格局，为动漫行业内原创制作公司、衍生品研发企业、创意人才提供专业、有效、广阔的展示、宣传、互动平台。  \r\n  国际频道  \r\n  广东电视台国际频道于2011年1月18日试播，是广东电视台通过卫星传送面向全球播出的全新电视频道。国际频道节目内容以新闻资讯和纪录片为主，播出语言以英语为主，普通话为辅，根据全球不同时差安排节目版面，全天24小时播出，面向西方主流社会、海外华侨和华人后裔。  \r\n  数字付费频道  \r\n  广东电视台数字付费电视是在南方广播影视传媒集团的领导和支持下，由广东电视台直接实施的电视媒体业务。目前，广东电视台旗下的数字付费电视专业频道已达八个，包括：《欧洲足球》频道、《高尔夫》频道、《英语辅导》频道、《岭南戏曲》频道、《房产》频道、《会展》频道、《快乐益智》频道、《快乐宠物》频道等，内容涵盖体育、娱乐、教育、产经等多个方面，为全国不同阶层的受众提供了丰富的个性化、专业化视听选择。  \r\n  高尔夫频道：“人谐自然，天乃岸，心为峰。”中国高尔夫第一媒体——高尔夫频道，是中国第一家也是目前国内唯一一家高尔夫专业数字电视频道。高尔夫频道于2006年1月1日正式开播，采用数字有线传输，覆盖全国。高尔夫频道每天24小时不间断为观众奉献高尔夫新闻、资讯、教学、历史文化专题等适应中国高尔夫爱好者兴趣和需求的各类高尔夫节目，其中重点美巡赛、欧巡赛、LPGA、亚巡赛等各大赛事的直播和录播节目。  \r\n  欧洲足球频道：欧洲足球频道是由国家广电总局批准设立的全国性数字付费频道。频道于2005年10月10日18时整正式开播，是中国首个为钟爱欧洲足球的球迷所开办的专业足球频道，同时也是一个进行全方位市场化运作的数字电视频道。欧洲足球频道转播欧洲顶级足球赛事，展现欧洲足球的发展趋势。频道以准确的定位、密集的赛事、深度的报道、精良的品质、独特的风格，成为一个贴近球迷生活，全面报道欧洲顶级足球赛事的足球专业频道。没有冗长的广告时段打扰，突破传统营销模式，为观众提供更多精彩足球赛事实况。频道配以资深评论员粤语、国语的多声道解说，专业性与观赏性并重。与赛事时时同步的比分资讯，新颖独家的幕后、专题节目，海外球星全程报道，为您24小时全天候播出。  \r\n  英语辅导频道：英语辅导频道是由广东电视台和蓝鸽集团合作开办的全国性数字付费电视频道。频道以营造英语辅导的家庭环境为特色，以提高全民英语水平为宗旨，是目前国内唯一一个面向家庭成员英语学习的专业化英语辅导类频道。频道开办至今已有四年，针对老幼、小学生和成人三个群体开设了12个栏目，节目着重于提高英语听说能力，强调实用性、娱乐性和科普性，做到各取所需，全家受用。&nbsp;  \r\n  快乐宠物频道：快乐宠物频道是国内唯一的专业宠物主题频道。尊重生命、倡导和谐，为爱宠人士提供最贴心的个性化服务，为宠物行业打造全方位的交流平台是频道的宗旨。汇集国内外宠物节目精品，内容集指导性、实用性、知识性和趣味性于一体。提供互动服务。不仅传授养宠知识，而且还提供各类宠物用品的电视购物和服务。倡导人与动物和谐共处，从更人性化角度展示人与动物的生活。&nbsp;  \r\n  会展频道：广东电视台会展频道是经国家广电总局批准成立的全国性数字付费电视频道。  自2009年初正式在广州（省、市全网）入网播出以来，会展频道在激烈的媒体市场竞争中不断摸索和创新，初步成长为一个传播权威展会资讯、解读行业动向、推广商业精品、引领主流消费，全方位服务商务人士和都市白领的特色专业电视频道。经过几年的运营，会展频道取得了一定的市场份额，影响力和知名度正在稳步提升。&nbsp;  \r\n  房产频道：房产频道是广东地区权威的房地产信息发布平台。其内容涵盖房地产一二级市场、房地产投资理财以及所有房地产相关行业的信息、资讯等。 房产频道也是广东省内唯一专注于房地产及周边行业的电视频道。与广州市国土房管局，各大发展商、中介行联合发布最新、最权威信息。为行业各界服务，提供优质宣传推广平台；为观众服务，制作最精美最优质的节目。&nbsp;  \r\n  岭南戏曲频道：岭南戏曲频道是由国家广电总局批准开播的、广东省内唯一的专业戏曲频道，于2007年11月28日正式开播，每天播出节目20个小时。频道以广东戏曲、传统文化和音乐为内容，以“高雅、文化、专业、传承”为主要风格，以“传承岭南风韵，再奏戏曲华章”为宗旨，开播一年多来，得到广大观众的一致好评。其特色在于以水墨动画作为宣传片，古典韵味浓厚，品味清新高雅，在众多数字电视频道中独树一帜。相信在不久的将来，岭南戏曲频道必将成为广东弘扬优秀岭南传统文化，繁荣广东戏曲艺术的主要阵地之一。&nbsp;  \r\n  快乐益智频道：快乐益智频道是经国家广电总局批准，在有线数字电视网络开播的全国频道。快乐益智频道每天播报全国教育资讯，并汇集国内外新鲜有趣的益智娱乐节目，在充满活力的互动节目形式中，让观众享受电视带来的乐趣并获得各类知识。  \r\n', '2013-09-22 08:50:31', 'http://www.anyv.net/attachments/2013/05/7316_2013050213172914bR3.jpg'),
