(1353, 'tonypaopao_orange                     ', '1、它是什么？  每天一篇文章，或者是推荐的好文章，或者是自己写的。无论是什么文字，我都会尽力避免矫情、造作，希望就像在面对  面和你对话！    它会有一张精心挑选的配图、每天或许还有一首为你准备的歌！  2、为什么做这个账号？   在这个有些浮躁的社会，我希望用这个账号践行我当一个文字编辑者的小梦想，慰藉自己，也希望给你力量！ 在这里不说成功学，不说畅销书，只希望营造一个心灵“桃花源”，每天打开看的时候都能静下来享受点简简单单的美好。 最后的最后，我很认真很努力地在做这件事，在现在的社会，这样的内容注定不是热门，但我相信只要坚持做，总会  越来越好！期望你的一个关注+1的支持！', '2013-09-22 09:09:11', 'http://www.anyv.net/attachments/2013/05/7796_201305061450011L32O.jpg'),
