(1356, '77313          i77313                     ', '&nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;让我们一起在游戏中体验并肩战斗的乐趣吧！\r\n&nbsp; &nbsp; &nbsp; 通过游戏我们被连接到了一起，原本陌路的过客成为了一起战斗的伙伴，没有游戏可能我们一生都没有并肩作战的机会，没去生命舞台上检验人性见证意志的机会，没有去守护和帮助别人的机会。有人说游戏让孩子变成了魔兽，但我认为游戏赋予了我们同理心，既理解他人的机会，这也是我们真正被游戏所吸引的地方。&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; 做电影的够牛逼吧？够光荣吧？但电影也只是单向的体验，游戏可以互动。做游戏的才是真正的“灵魂工程师”呢，游戏集技术、艺术、人性与主观能动性为一体，是人类文明的未来，甚至可能会成为人类认清自己“从哪里来，到哪里去”的一面镜子。', '2013-09-22 09:09:11', 'http://www.anyv.net/attachments/2013/05/7619_201305041855041x3Rz.jpg'),
